(1, 4, 'date', '%M %Y', '', 'May 2018', '', 'select concat(date_format({name},\'{data}\'),if(date_format({name},\'%M\')=\'December\',date_format(nextdeadline,\'/{data}\'),\'\')) from newsletter.newsletters where iscurrent', 'Newsletter Parameter', 'This is used to extract the correct date information for the newsletter.'),
(2, 3, 'number', '', '', '1', '', 'select {name} from newsletter.newsletters where iscurrent', 'Newsletter Parameter', 'This is used to extract the correct date information for the newsletter.'),
(3, 5, 'nextdeadline', '%W, %e %M %Y', '', 'Thursday, 24 May 2018', '', 'select date_format({name},\'{data}\') from newsletter.newsletters where iscurrent', 'Newsletter Parameter', 'This is used to extract the correct date information for the newsletter.'),
